import React from 'react';
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";
import DatePicker from "react-datepicker/es";
import Image from "react-bootstrap/Image";

const MyDataPicker = ({handleChange, startDate}) => (
    <Row>
        <Col sm={8}>
            <label>
                <div style={{display: 'block', whiteSpace: 'nowrap'}}>
                <DatePicker
                    className="form-control"
                    onChange={handleChange}
                    minDate={new Date()}
                    placeholderText={startDate.getDate()}
                />
                <Image alt='' src="https://img.icons8.com/ultraviolet/40/000000/today.png"
                       style={{pointerEvents: 'none', marginBottom: '5px'}}
                />
                </div>
            </label>
        </Col>
    </Row>

);
export default MyDataPicker;
